    const [Lang,SetLang]=React.useState('EN')

    let LangEN,LangDE;

    if(Lang === 'EN'){
        LangEN = 'block'
        LangDE = 'none'
    } else if (Lang === 'DE'){
        LangDE='block'
        LangEN='none'       
    }

    const [Fntsze,SetFntsze]=React.useState(20)

return(
    <div>

        <Title/>

        <Navbar onUpdate = {(value:string) => SetLang(value)} pg_Activities = '4px solid red'/>

        <div className = 'txt_box'>

        <h1 style={{display:LangEN}}>Activities</h1>
        <h1 style={{display:LangDE}}>Aktivit√§ten</h1>

        <Font fntSlct={(sze:number)=>SetFntsze(sze)} LangEN={LangEN} LangDE={LangDE}/>

        <hr className='hr_a'></hr>

        <ul style={{fontSize:Fntsze,lineHeight:'2em'}}>
            <li>Regular meetings on Tuesdays at 10 o'clock,where the following items will be discussed: </li>

                <ul>
                    <li>Guidance and assistance with those day-to-day issues.</li>
                </ul>

        </ul>




        </div>

    </div>
)

}
